import  Axios from 'axios';
import React,{useState} from 'react'
import Header from './Header';
import "./Register.css";


export default function Login() {
  const [logemail, set] = useState('');
  const [logpassword, setPass] = useState('');

  const login = () => {
    Axios.post('/login', {
      email:logemail,
      password:logpassword,
    })
      .then(response => {
        console.log(response)
      })
      .catch(err => { throw err });
  };



  return (
    <Header title='Login'>
      <form className="register-form">
    <div className="home">

      <div className="inputs">


            <h3>Username:</h3>
                            <input type="email" onChange={(e) => { setlog(e.target.value) }} name="logemail"/>
            <h3>Password:</h3>
                             <input type="password" onChange={(e) => { setpass(e.target.value) }} name="logpassword"/>



            <button type='button' onClick={login} className="button">Login</button> 
            <br/> <br/>


            <a href="/Register"> Register </a>



      </div>


      </div></form></Header>


    );}
